import styled from 'styled-components'

export const CardStyle = styled.div`

    .card {
        width: 370px;
        height: 150px;
        background: #1E212A;
        display: flex;
        justify-content: center;
        margin-left: 100px;
        border-radius: 15px;
    }

    .centralBorder {
        background: #00FF7F;
        width: 360px;
        height: 140px;
        margin-top: 5px;
        display: flex;
        border-radius: 15px; 
        justify-content: space-between;
    }


    .image {
        width: 115px;
        height: 115px;
        background: red;
        margin-top: 15px;
    }


`
